@import "../base/variables.scss";

.date-picker {
  width: 170px;
  height: 25px;
  padding: 0;
  border: 0;
  line-height: 25px;
  padding-left: 10px;
  font-size: 12px;
  font-family: Arial, sans-serif;
  font-weight: bold;
  cursor: pointer;
  color: #303030;
  position: relative;
  z-index: 2;
}

.date-picker-wrapper {
  position: absolute;
  z-index: 1;
  border: 1px solid $color-ds25;
  border-radius: 4px;
  background-color: #fff;
  padding: 19px;
  font-size: 12px;
  line-height: 20px;
  color: $color-purple;
  font-family: Arial, sans-serif;
  box-shadow: 0px 10px 20px $color-ds5;
  box-sizing: initial;
}

.dp-clearfix {
  clear: both;
  height: 0;
  font-size: 0;
}

.date-picker-wrapper {
  &.inline-wrapper {
    position: relative;
    box-shadow: none;
    display: inline-block;
  }

  &.single-date {
    width: auto;
  }

  &.no-shortcuts {
    padding-bottom: 20px;
  }

  &.no-topbar {
    padding-top: 20px;
  }

  .footer {
    font-size: 11px;
    padding-top: 3px;
  }

  b {
    color: #666;
    font-weight: 700;
  }

  a {
    color: rgb(107, 180, 214);
    text-decoration: uppercase;
  }

  .month-name {
    text-transform: capitalize;
  }

  .select-wrapper {
    position: relative;
    overflow: hidden;
    display: inline-block;
    vertical-align: middle;

    &:hover {
      text-decoration: underline;
    }
  }

  .month-element {
    display: inline-block;
    vertical-align: middle;
    color: $color-ds100;
    font-size: 19px;
  }

  .select-wrapper select {
    position: absolute;
    margin: 0;
    padding: 0;
    left: 0;
    top: -1px;
    font-size: inherit;
    font-style: inherit;
    font-weight: inherit;
    text-transform: inherit;
    color: inherit;
    cursor: pointer;
    -webkit-appearance: none;
    -moz-appearance: none;
    appearance: none;
    background: transparent;
    border: 0;
    outline: 0;
    -ms-filter: "progid:DXImageTransform.Microsoft.Alpha(Opacity=1)";
    filter: alpha(opacity=1);
    opacity: 0.01;
  }

  .month-wrapper {

    border-radius: 3px;
    background-color: #fff;

    cursor: default;
    position: relative;
    _overflow: hidden;

    table {
      width: 280px;
      float: left;
      font-size: 12px;

      &.month2 {
        width: 190px;
        float: left;
      }

      th,
      td {
        height: 40px;
        width: 40px;
        vertical-align: middle;
        text-align: center;
        line-height: 40px;
        margin: 0px;
        padding: 0px;
      }

      div.day,
      .real-today {
        // padding: 5px 0;
        line-height: 40px;
        font-size: 12px;
        margin-bottom: 1px;
        color: #ffffff;
        cursor: default;
      }

      div.day {

        &.lastMonth,
        &.nextMonth {
          color: $color-ds25;
          cursor: default;
        }
      }

      .day.checked {
        background-color: rgb(156, 219, 247);
      }

      .week-name {
        height: 40px;
        font-size: 12px;
        line-height: 20px;
        font-weight: 100;
        text-transform: capitalize;
      }

      .day.has-tooltip {
        cursor: help !important;

        .tooltip {
          white-space: nowrap;
        }
      }
    }
  }

  .time label {
    white-space: nowrap;
  }

  .month-wrapper table .day {
    &.toMonth {
      &.valid {
        color: $color-ds50;
        cursor: pointer;

      }

      &.real-today {
        color: #ffffff;
        font-weight: bold;
      }

      &.hovering {
        background: $color-purple-gradient25;
        border-radius: 22px
      }
    }

    &.nextMonth,
    &.lastMonth {
      // display: none;
    }

    &.real-today {
      background: $color-green-gradient;
      border-radius: 22px;

      &.checked,
      &.hovering {
        background-color: rgb(112, 204, 213);
      }
    }
  }

  table .caption {
    height: 24px;
    border-bottom: 20px solid white;

    >th {

      &:first-of-type,
      &:last-of-type {
        width: 27px;
      }
    }

    .next,
    .prev {
      line-height: 24px;
      cursor: pointer;
    }

    .next:hover,
    .prev:hover {
      background-color: white;
      color: $color-ds100;
    }
  }

  .gap {
    position: relative;
    z-index: 1;
    width: 15px;
    height: 100%;
    background-color: red;
    font-size: 0;
    line-height: 0;
    float: left;
    top: -5px;
    margin: 0 10px -10px;
    visibility: hidden;
    height: 0;

    .gap-lines {
      height: 100%;
      overflow: hidden;
    }

    .gap-line {
      height: 15px;
      width: 15px;
      position: relative;

      .gap-1 {
        z-index: 1;
        height: 0;
        border-left: 8px solid white;
        border-top: 8px solid #eee;
        border-bottom: 8px solid #eee;
      }

      .gap-2 {
        position: absolute;
        right: 0;
        top: 0px;
        z-index: 2;
        height: 0;
        border-left: 8px solid transparent;
        border-top: 8px solid white;
      }

      .gap-3 {
        position: absolute;
        right: 0;
        top: 8px;
        z-index: 2;
        height: 0;
        border-left: 8px solid transparent;
        border-bottom: 8px solid white;
      }
    }

    .gap-top-mask {
      width: 6px;
      height: 1px;
      position: absolute;
      top: -1px;
      left: 1px;
      background-color: #eee;
      z-index: 3;
    }

    .gap-bottom-mask {
      width: 6px;
      height: 1px;
      position: absolute;
      bottom: -1px;
      left: 7px;
      background-color: #eee;
      z-index: 3;
    }
  }

  .selected-days {
    display: none;
  }

  .drp_top-bar {
    line-height: 1.4;
    position: relative;
    padding: 10px 40px 10px 0;

    .error-top,
    .normal-top {
      display: none;
    }

    .default-top {
      display: block;
    }

    &.error {
      .default-top {
        display: none;
      }

      .error-top {
        display: block;
        color: red;
      }
    }

    &.normal {
      .default-top {
        display: none;
      }

      .normal-top {
        display: block;

        .selection-top {
          color: #333;
        }
      }
    }

    .apply-btn {
      position: absolute;
      right: 0px;
      top: 6px;
      padding: 3px 5px;
      margin: 0;
      font-size: 12px;
      border-radius: 4px;
      cursor: pointer;
      color: #d9eef7;
      border: solid 1px #0076a3;
      background: #0095cd;
      background: -webkit-gradient(linear, left top, left bottom, from(#00adee), to(#0078a5));
      background: -moz-linear-gradient(top, #00adee, #0078a5);
      filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#00adee', endColorstr='#0078a5');
      color: white;
      line-height: initial;

      &.disabled {
        cursor: pointer;
        color: #606060;
        border: solid 1px #b7b7b7;
        background: #fff;
        background: -webkit-gradient(linear, left top, left bottom, from(#fff), to(#ededed));
        background: -moz-linear-gradient(top, #fff, #ededed);
        filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#ffffff', endColorstr='#ededed');
      }
    }
  }

  .time {
    position: relative;
  }

  &.single-month .time {
    display: block;
  }

  .time input[type=range] {
    vertical-align: middle;
    width: 129px;
    padding: 0;
    margin: 0;
    height: 20px;
  }

  .time1 {
    width: 180px;
    padding: 0 5px;
    text-align: center;
  }
}

/*time styling*/

.time2 {
  width: 180px;
  padding: 0 5px;
  text-align: center;
}

.date-picker-wrapper {
  .time1 {
    float: left;
  }

  .time2 {
    float: right;
  }

  .hour {
    text-align: right;
  }
}

.minute {
  text-align: right;
}

