  .hide {
    display: none;
  }

  .first-date-selected,
  .last-date-selected {
    background: $color-purple-gradient !important;
    color: white !important;
    border-radius: 22px;
    font-weight: bold;
  }

  .date-range-length-tip {
    position: absolute;
    margin-top: -4px;
    margin-left: -8px;
    box-shadow: 0 0 3px rgba(0, 0, 0, 0.3);
